"use client";

import FullDiv from "react-div-100vh";
import "@fontsource/dm-sans/index.css";
import {useEffect, useState} from "react";
import {initiateUserAuthentication, verifyUser} from "@/app/actions";
import {useRouter} from "next/navigation";

export default function Home() {
    const router = useRouter();

    const [userId, setUserId] = useState(typeof window !== "undefined" ? localStorage.uid : undefined);
    const [session, setSession] = useState(typeof window !== "undefined" ? localStorage.session : undefined);

    useEffect(() => {
        if (userId && session) {
            router.push("/items");
        }
    }, [userId, session]);

    return <LandingUI userId={userId}/>;
}

function LandingUI({userId}: {userId: string | undefined}) {
    const [stage, setStage] = useState(userId ? 2 : 0);
    const [mode, setMode] = useState<"email" | "phone">("email");
    const [email, setEmail] = useState("");
    const [phone, setPhone] = useState("");
    const [code, setCode] = useState("");

    const submit = async () => {
        const id = await initiateUserAuthentication(!!email ? email : undefined, !!phone ? phone : undefined);
        console.log(id);
        if (typeof window !== "undefined") localStorage.uid = id;
        setStage(2);
    }

    const verify = async () => {
        if (typeof window !== "undefined") {
            return;
        }
        const session = await verifyUser(localStorage.uid!, code);
        console.log(session);
        localStorage.session = session;
        setStage(3);
    }

    return <FullDiv className="flex justify-center items-center">
        <style jsx global>{`
          :root {
            background-color: rgb(253 230 138) !important;
          }
        `}</style>

        <div className="bg-white rounded-xl shadow-sm flex">
            <div className="pl-6 py-6 flex flex-col justify-between w-96">
                <div>
                    {stage === 0 && <>
                        <h1 className="font-dm font-semibold mb-5">Welcome to TagIt</h1>
                        <p className="font-dm">Using TagIt, you can quickly generate QR codes for your items so they can be returned to you as quickly as possible if lost.</p>
                    </>}
                    {stage === 1 && <>
                        <h1 className="font-dm font-semibold mb-5">How would you like to be contacted?</h1>
                        <div className="flex gap-2 mb-6">
                            <button onClick={() => {setMode("email")}} className={`rounded-md shadow-sm py-1 px-2 font-semibold ring-1 ${mode === "email" ? "bg-orange-400 hover:bg-orange-300 ring-orange-300" : "bg-white hover:bg-gray-200 ring-orange-300"}`}>Email</button>
                            <button onClick={() => {setMode("phone")}} className={`rounded-md shadow-sm py-1 px-2 font-semibold ring-1 ${mode === "phone" ? "bg-orange-400 hover:bg-orange-300 ring-orange-300" : "bg-white hover:bg-gray-200 ring-orange-300"}`}>Phone</button>
                        </div>
                        <p className="text-sm font-semibold font-dm mb-1.5">{mode === "email" ? "Please enter your email" : "Please enter your phone number"}</p>
                        {mode === "email" && <input type="email" value={email} onChange={e => setEmail(e.target.value)} className="w-full p-2 ring-orange-400 focus:ring-orange-300 ring-2 rounded-md shadow-sm focus:outline-none" placeholder="you@example.com"/>}
                        {mode === "phone" && <input type="tel" value={phone} onChange={e => setPhone(e.target.value)} className="w-full p-2 ring-orange-400 focus:ring-orange-300 ring-2 rounded-md shadow-sm focus:outline-none"/>}
                    </>}
                    {stage === 2 && <>
                        <h1 className="font-dm font-semibold mb-5">{userId ? "Welcome back" : "Thanks"}</h1>
                        <p className="text-sm font-semibold font-dm mb-1.5">{mode === "email" ? "Please enter the code sent to your email" : "Please enter the code sent to your phone"}</p>
                        <input type="text" value={code} onChange={e => setCode(e.target.value)} className="w-full p-2 ring-orange-400 focus:ring-orange-300 ring-2 rounded-md shadow-sm focus:outline-none" placeholder="000000"/>
                    </>}
                </div>
                {stage === 0 && <button className="rounded-md shadow-sm bg-orange-500 hover:bg-orange-400 text-white text-lg font-semibold px-6 py-1.5 w-full" onClick={() => {setStage(1)}}>Get Started</button>}
                {stage === 1 && <button disabled={!/[^@]+@[^.]+\..+/.test(email)} className="rounded-md shadow-sm bg-orange-500 enabled:hover:bg-orange-400 disabled:opacity-60 text-white text-lg font-semibold px-6 py-1.5 w-full" onClick={submit}>Continue</button>}
                {stage === 2 && <button disabled={code.length !== 6} className="rounded-md shadow-sm bg-orange-500 enabled:hover:bg-orange-400 disabled:opacity-60 text-white text-lg font-semibold px-6 py-1.5 w-full" onClick={verify}>Continue</button>}
            </div>
            <div>
                <HeroOne/>
            </div>
        </div>
    </FullDiv>
}

